import React from 'react';
import './App.css';
import Page1 from './components/Page1';
import Page2 from './components/Page2';
import {
  Container,
  Row,
}from 'reactstrap'

export default class App extends React.Component{
  render(){
    return(
      <Container fulid={true} className=".container-fluid home">
        <Row>
          <Page1/>
        </Row>
        <Row>
        <Page2/>
        </Row>
      </Container>
    );
  }
}
